import React from 'react';

const PhoneList = props => {
	const shortNumbers = props.shortNumbers.map(number => {
    	return (
   			<div>
        		<div className="ui center aligned grid">
      			<div className="four wide column">1</div>
		        <div className="four wide column">2</div>
		        <div className="four wide column">{number.short_number}</div>
		        <div className="four wide column">
		        	<button className="ui button">Delete</button>
		        		<div className="ui button" tabIndex="0">Modify</div>
		        	</div>
		      	</div>
    		</div>
    	);
	});

	return <div>{shortNumbers}</div>;
};

export default PhoneList;
